  //{{{  uciArgv
  
  cwtchStruct.prototype.uciArgv = function () {
  
    if (process.argv.length > 2) {
      for (let i=2; i < process.argv.length; i++)
        this.uciExec(process.argv[i]);
    }
  
  }
  
